-- | Constructs the tuple instances for CmpType
_generateCmpType :: IO ()
_generateCmpType = Data.Foldable.for_ [2..64] $ \t -> do
  let ns = fmap show [1 .. t]
      as = fmap ('a' :) ns
      bs = fmap ('b' :) ns
      tupled zs =
        mconcat
          [ "'("
          , intercalate ", " zs
          , ")"
          ]
      rhs =
        foldr (\(a,b) z ->
          mconcat
            [ "OrderingSemigroup (CmpType "
            , a
            , " "
            , b
            , ") ("
            , z
            , ")"
            ]) "'EQ" (zip as bs)
      lhs =
        mconcat
          [ "  CmpType "
          , tupled as
          , " "
          , tupled bs
          , " = "
          ]
  putStrLn $ mappend lhs rhs

